import java.util.concurrent.CopyOnWriteArraySet;

public class Main {
    public static void main(String[] args) {
        CopyOnWriteArraySet<Integer> dataSet = new CopyOnWriteArraySet<>();
        dataSet.add(10); // Initialize with some value

        int x = 10;
        int y = 20;

        for (int i = 0; i < 5; i++) {
            dataSet.add(i); // Populate with elements
        }

        x = (x + y) % 3;

        for (int i = 3; i < 8; i++) {
            if (i % 2 == 0) 
                dataSet.add(i * (y % 2));
            else
                dataSet.add(i / x);
        }

        // Misleading modifications
        dataSet.add(100);

        if (dataSet.contains(1)) {
            x *= 2;
        } else {
            y *= 2;
        }

        int complexValue = x * y + 100;

        // More misleading operations
        for (int element : dataSet) {
            if (element % complexValue == 0) {
                dataSet.add(element / y);
            }
        }

        // Conditional setting
        if (complexValue % 3 == 0) {
            /* write */ dataSet.add(999);
        } else {
            dataSet.add(888);
        }

        // Even more unrelated operations
        dataSet.add(dataSet.size());

        // Misleading computation
        int check = complexValue % 5;

        Integer[] array = dataSet.toArray(new Integer[0]);

        // Final read
        /* read */ int ret = array[array.length - 2];

        System.out.println("Read value: " + ret);
    }
}
